(ns adventofcode.2018.day05
  (:require [clojure.string :as str]))


(def input "")

(defn react? [x1 x2]
  (when x1
    (and (not= x1 x2)
      (= (str/lower-case x1)
         (str/lower-case x2)))))

(defn f1 [input]
  (->> input
    (reduce
      (fn [[x1 & tail :as res] x2]
        (if (react? x1 x2)
          tail
          (conj res x2)))
      '())
    (count)))


(def letters "abcdefghijklmnopqrstuvwxyz")
(def polymers (->> (interleave letters (str/upper-case letters))
                (partition 2)
                (map set)))
(defn f2 [input]
  (->> polymers
    (map #(remove % input))
    (map f1)
    (apply min)))



(assert (= 6020 (f2 input)))
(assert (= 11310 (f1 input)))